import React from "react";
import {
  SideBar,
  SideBarWrapper,
  SideBarMenu,
  SideBarTitle,
  SideBarListItem,
  SideBarList,
} from "./SideBarElements.js";
import { AiOutlineDashboard, AiOutlineSetting } from "react-icons/ai";

const SideBarDD = () => {
  return (
    <>
      <SideBar>
        <SideBarWrapper>
          <SideBarMenu>
            <SideBarTitle>PAGES</SideBarTitle>
            <SideBarList>
              <SideBarListItem>
                <AiOutlineDashboard />
                DASHBOARD
              </SideBarListItem>
              <SideBarListItem>SETTINGS</SideBarListItem>
              <SideBarListItem>MESSAGES</SideBarListItem>
              <SideBarListItem>ACCOUNT</SideBarListItem>
            </SideBarList>
          </SideBarMenu>
        </SideBarWrapper>
      </SideBar>
    </>
  );
};

export default SideBarDD;
